sources.scss\\variables.scss:
$yellow: #FFED00;
$green: #40C700;
$soft-black: #2B2A29;
$red: #ED1C24;
$blue: #004990;

//--------DEVICE SIZE--------
$small-mobile: 400px;
$tablet-width: 648px;
$desktop-width: 1023px;
$container-width: 1200px;

@mixin small-mobile {
  @media (max-width: $small-mobile) {
    @content;
  }
}

@mixin mobile {
  @media (max-width: #{$tablet-width - 1px}) {
    @content;
  }
}

@mixin tablet {
  @media (max-width: #{$desktop-width}) {
    @content;
  }
}


@mixin desktop {
  @media (min-width: #{$desktop-width + 1px}) {
    @content;
  }
}

@mixin container {
  @media (min-width: #{$desktop-width}) and (max-width: #{$container-width}) {
    @content;
  }
}

sources.main.scss:
@import 'scss/reset.scss';
@import 'scss/variables.scss';
@import 'scss/select2.min.scss';

html {
    font-size: 15px;
    color: $soft-black;

    @include container {
        font-size: 14px;
    }
}

body {
    font-family: 'Montserrat', sans-serif;
    overflow-x: hidden;
    max-width: 100vw;
}

.container {
    max-width: 1150px;
    display: block;
    margin: auto;

    @include container {
        padding-left: 25px;
        padding-right: 25px;
    }

    @include tablet {
        padding: 0 30px;
    }

    @include mobile {
        padding: 0 20px;
    }

}

@import 'scss/button.scss';
@import 'scss/header.scss';
@import 'scss/menu.scss';
@import 'scss/footer.scss';
@import 'scss/subtitle.scss';
@import 'scss/welcome.scss';
@import 'scss/categories.scss';
@import 'scss/markets.scss';
@import 'scss/services.scss';
@import 'scss/about.scss';
@import 'scss/form.scss';
@import 'scss/call-animation.scss';

sources.scss\\button.scss:
.button {
    color: #FFFFFF;
    font: inherit;
    font-weight: bold;
    font-size: 13px;
    line-height: 25px;
    text-align: center;
    padding: 7px 22px;
    border: 0;
    background-color: $green;
    position: relative;
    cursor: pointer;
    border-radius: 20px;
    box-shadow: 0px 2px 20px rgba(0, 0, 0, 0.075);
    transition: all ease-out .2s;
    
    &:hover {
        box-shadow: 0px 2px 20px rgba(0, 0, 0, 0.281);
    }

    &_yellow {
        background-color: $yellow;
        color: $soft-black;
    }
}

sources.scss\\header.scss:
.header {
    padding-top: 10px;
    position: relative;

    @include tablet {
        padding-top: 20px;
    }

    .container {
        display: flex;
        justify-content: space-between;
        align-items: stretch;

        @include tablet {
            background: #fff;
            flex-wrap: wrap;
            align-items: flex-end;
        }
    }

    &:before {
        content: '';
        background: $yellow;
        top: 0;
        left: 40px;
        width: 130vw;
        height: 1180px;
        transform: rotate(-7deg) translateY(-50%);
        border-bottom-left-radius: 100px;
        position: absolute;
        z-index: -1;

        @include tablet {
            width: 100vw;
            left: 0;
            transform: unset;
            border-radius: 0;
            height: 928px;
        }
    }

    &__hot {
        display: flex;
        align-items: flex-end;
        cursor: pointer;

        @include tablet {
            margin-top: 8px;
        }

        b {
            font-weight: bold;
            padding: 0px 9px 2px;
        }
    }

    &__logo {
        display: block;
        margin-top: 28px;

        img {
            max-width: 100%;
        }

        @include tablet {
            max-width: 50vw;
        }
    }

    &__middle {
        flex: auto;
        padding-left: 57px;
        margin-bottom: 10px;
        align-self: flex-end;
        position: relative;

        @include tablet {
            padding-left: 0;
            margin-top: 20px;
            width: 100%;
        }

        &:before {
            content: '';
            display: block;
            border: 42px solid transparent;
            border-left: 130vw solid #FFF;
            left: 50%;
            top: 50%;
            transform: translate(-50%, -50%);
            z-index: -1;
            position: absolute;

            @include tablet {
                display: none;
            }
        }
    }

    &__right {
        display: flex;
        flex-direction: column;
        align-items: center;
        padding-top: 5px;

        @include tablet {
            display: none;
        }
    }

    &__link {
        text-decoration: none;
        color: inherit;
    }

    &__tel {
        font-weight: bold;
        font-size: 20px;
        line-height: 20px;
    }

    &__mail {
        font-weight: 300;
        font-size: 16px;
        line-height: 25px;
    }

    &__callback {
        margin-top: 7px;
    }
}

sources.scss\\menu.scss:
.menu {
    color: $soft-black;
    display: flex;
    font-weight: normal;
    font-size: 12px;
    line-height: 25px;

    @include tablet {
        display: none;
        font-size: 14px;
    }

    &__item {
        margin-right: 35px;
        list-style: none;
        transition: ease-out .12s;

        @include container {
            margin-right: 20px;
        }

        @include tablet {
            margin-right: 0;
            margin-bottom: 10px;
            font-size: 16px;
            font-weight: 500;
        }

        &:hover {
            transform: scale(1.3);

            @include tablet {
                transform: unset;
            }
        }

        &:last-child {
            margin-right: 0;
            margin-bottom: 0;
        }

        a {
            text-decoration: none;
            color: inherit;
        }
    }

    &__btn {
        display: none;
        cursor: pointer;

        span {
            height: 4px;
            width: 45px;
            background-color: $yellow;
            margin-bottom: 6px;
            transition: all ease-in-out .2s;
        }

        &.active {
            span:nth-child(1) {
                transform-origin: left;
                transform: rotate(27deg);
            }

            span:nth-child(2) {
                opacity: 0;
            }

            span:nth-child(3) {
                transform-origin: left;
                transform: rotate(-28deg);
            }
        }

        @include tablet {
            display: flex;
            flex-direction: column;
        }
    }
}

sources.scss\\footer.scss:
.footer {
    padding-top: 128px;
    padding-bottom: 122px;
    position: relative;
    overflow: hidden;

    @include tablet {
        padding-bottom: 0;
        padding-top: 40px;
    }

    &:before {
        content: "";
        background: #2B2A29;
        top: 0;
        right: 30px;
        width: 130vw;
        height: 700px;
        transform: rotate(-7deg) translateY(27%);
        border-radius: 100px;
        position: absolute;
        z-index: -1;

        @include tablet {
            transform: unset;
            right: 0;
            width: 100%;
            height: 80%;
            top: auto;
            bottom: 0;
            border-radius: 0;
        }
    }

    .container {
        border-bottom: 1px solid #fff;
        padding-bottom: 27px;
        display: flex;
        align-items: flex-end;

        @include tablet {
            flex-wrap: wrap;
            border-bottom: 0;
        }
    }

    &__left {
        width: 50%;
        max-width: 561px;

        @include tablet {
            width: 100%;
        }
    }

    &__logo {
        @include tablet {
            width: 100%;
            text-align: center;

            img {
                max-width: 100%;
            }
        }
    }

    &__info {
        box-shadow: -4px -4px 15px rgba(0, 0, 0, 0.25);
        border-radius: 50px;
        overflow: hidden;
    }

    &__info-top {
        padding: 35px 39px 24px;
        background-color: #fff;
        display: flex;
        justify-content: space-between;

        @include tablet {
            flex-direction: column;
            padding: 30px 25px;
        }
    }

    &__info-links {
        display: inline-flex;
        flex-direction: column;
        align-items: center;

        @include tablet {
            margin-top: 15px;
        }
    }

    &__info-link {
        display: block;
        text-decoration: none;
        color: inherit;

    }

    &__info-tel {
        font-weight: bold;
        font-size: 20px;
        line-height: 20px;
    }

    &__info-mail {
        font-weight: 300;
        font-size: 16px;
        line-height: 25px;
    }

    &__info-bottom {
        background-color: $yellow;
        padding: 27px 19px;
        text-align: center;
        font-size: 17px;

        b {
            font-weight: bold;
        }
    }

    &__mailing {
        margin-top: 37px;
        display: flex;
        justify-content: space-between;
        align-items: center;
        position: relative;

        @include tablet {
            justify-content: flex-start;
            flex-wrap: wrap;
        }
    }

    &__subscribe-txt {
        font-weight: bold;
        font-size: 20px;
        line-height: 20px;
        max-width: 180px;
        margin-left: 31px;
        color: #fff;
    }

    &__subscribe-field-wrap {
        display: flex;
        align-items: center;
        width: 100%;
    }

    &__subscribe-field {
        background: #FFFFFF;
        border: 1px solid rgba(34, 34, 34, 0.25);
        box-shadow: 0px 20px 30px rgba(34, 34, 34, 0.07);
        border-radius: 50px;
        font: inherit;
        font-size: 12px;
        line-height: 12px;
        padding: 15px 50px 15px 15px;
        margin-left: 15px;
        flex: 1;

        &::placeholder {
            color: rgba(34, 34, 34, 0.2);
        }

        @include tablet {
            width: 100%;
            margin-left: 0;
            margin-top: 15px;
            flex: 1 100%;
        }
    }

    &__subscribe-btn {
        border-radius: 50%;
        height: 40px;
        width: 40px;
