.categories-block {
    margin-top: 104px;

    @include mobile {
        margin-top: 45px;
    }

    &__grid {
        display: grid;
        grid-template-columns: repeat(auto-fit, minmax(310px, 1fr));
        grid-gap: 5px 20px;
        margin-top: 16px;

        @include mobile {
            padding-right: 0;
            grid-template-columns: repeat(auto-fit, minmax(290px, 1fr));
        }

        &_short {
            .categories-block__grid-item:nth-of-type(n+10) {
                display: none;
            }

            @include tablet {
                .categories-block__grid-item:nth-of-type(n+7) {
                    display: none;
                }
            }

            @include mobile {
                .categories-block__grid-item:nth-of-type(n+4) {
                    display: none;
                }
            }
        }
    }

    &__cat-name {
        display: flex;
        align-items: center;
        cursor: pointer;

        &:hover {
            .categories-block__cat-icon {
                transform: translateX(5px);
            }
        }
    }

    &__cat-icon {
        width: 100px;
        min-width: 100px;
        height: 100px;
        background-color: $yellow;
        border-radius: 50%;
        position: relative;
        z-index: 1;
        transition: all ease-out .18s;

        @include mobile {
            width: 80px;
            height: 80px;
            min-width: 80px;
        }

        img {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            height: 65%;
            width: 65%;
            object-position: center;
            object-fit: contain;
        }
    }

    &__cat-title {
        display: inline-flex;
        margin-left: -20px;
        color: #FFF;
        text-decoration: none;
        position: relative;
        z-index: -1;
        max-width: 70%;

        @include mobile {
            flex: 1;
            max-width: 100%;
        }

        h2 {
            background-color: $soft-black;
            font-size: 15px;
            line-height: 20px;
            font-weight: 300;
            display: inline;
            padding: 6px 17px 9px 47px;

            @include container {
                padding: 6px 17px 9px 31px;
            }

            @include mobile {
                width: 100%;
                padding: 6px 17px 9px 30px;
            }
        }

        &:after {
            content: '';
            display: block;
            height: 100%;
            transform: skewX(-20deg);
            background-color: $soft-black;
            width: 38px;
            border-radius: 7px;
            position: absolute;
            right: -20px;
            top: 0;

            @include mobile {
                display: none;
            }
        }

        &_reverse:after {
            transform: skewX(20deg);
        }
    }

    &__subcats-list-wrap {
        padding-left: 100px;
        margin-top: -15px;
        position: relative;
        z-index: 1;

        @include container {
            margin-top: -5px;
        }

        @include mobile {
            margin-top: -5px;
            padding-left: 80px;
            padding-right: 20px;
        }
    }

    &__subcats-list {
        &_short {
            .categories-block__subcat:nth-of-type(n+4) {
                display: none;
            }
        }
    }

    &__subcat {
        font-weight: 300;
        font-size: 15px;
        line-height: 15px;
        margin-bottom: 5px;
        display: flex;
        align-items: flex-start;

        @include mobile {
            font-size: 14px;
            line-height: 14px;
            margin-bottom: 4px;
        }

        &:before {
            content: url("data:image/svg+xml,%3Csvg width='7' height='7' viewBox='0 0 7 7' fill='none' xmlns='http://www.w3.org/2000/svg'%3E%3Ccircle cx='4.5' cy='4.5' r='2.5' fill='%23FFED00'/%3E%3Ccircle cx='2.5' cy='2.5' r='2.5' fill='%232B2A29'/%3E%3C/svg%3E%0A");
            margin-right: 4px;
            margin-top: -2px;
        }

        a {
            text-decoration: none;
            color: inherit;
        }
    }

    &__show-all {
        border: 0;
        padding: 0;
        background: transparent;
        font: inherit;
        font-weight: 500;
        font-size: 15px;
        line-height: 15px;
        display: flex;

        &:before {
            content: url("data:image/svg+xml,%3Csvg width='9' height='6' viewBox='0 0 9 6' fill='none' xmlns='http://www.w3.org/2000/svg'%3E%3Cpath fill-rule='evenodd' clip-rule='evenodd' d='M3.99994 5L-7.54769e-05 1.00001L0.707031 0.292908L4.49994 4.5L3.99994 5Z' fill='%232B2A29'/%3E%3Cpath fill-rule='evenodd' clip-rule='evenodd' d='M8.2425 0.999958L3.99985 4.99997L3.49988 4.5L7.5354 0.292851L8.2425 0.999958Z' fill='%232B2A29'/%3E%3C/svg%3E%0A");
            margin-right: 3px;
            margin-top: -1px;
            transition: ease-out 0.12s;
        }

        &.active:before {
            transform: scaleY(-1);
            margin-top: 3px;
        }
    }

    &__more {
        margin: 48px auto 0;
        display: block;

        &.active {
            background-color: $red;
        }
    }
}

sources.scss\\markets.scss:
.markets-block {
    margin-top: 72px;

    &__grid {
        margin-top: 73px;
        display: grid;
        grid-template-columns: repeat(4, 1fr);
        justify-content: space-between;
        grid-gap: 45px 40px;

        @include tablet {
            grid-template-columns: repeat(3, 1fr);
        }

        @include mobile {
            margin-top: 0;
            padding: 0;
            grid-gap: 0;
            justify-content: flex-start;
        }
    }

    &__slider {

        @include mobile {
            margin-top: 40px;
            width: 100%;

            .swiper-slide {
                padding: 10px 0;
                width: 120px;
                display: flex;
                justify-content: center;
            }
        }

        @media screen and (min-width: 400px) {
            .swiper-slide {
                @include mobile {
                    display: flex;
                }

                &-active {
                    justify-content: flex-end;
                }

                &-next {
                    justify-content: flex-start;
                }
            }
        }
    }

    &__nav {
        display: none;

        @include mobile {
            display: block;
        }
    }

    &__arrow {
        min-width: 50px;
        min-height: 50px;

        &:after {
            transform: scale(.6);
            color: black;
        }
    }

    &__item {
        position: relative;
        width: 100px;
        height: 100px;
        border-radius: 50%;
        background-color: $yellow;
        display: block;

        &:hover {
            .markets-block__icon {
                margin-left: -5px;
            }
        }

        @include mobile {
            display: flex;
            align-items: center;
            justify-content: center;
        }

    }

    &__percent {
        font-weight: 800;
        font-size: 16px;
        line-height: 19px;
        color: #fff;
        width: 38px;
        height: 38px;
        text-align: center;
        display: flex;
        align-items: center;
        justify-content: center;
        background-color: $soft-black;
        border-radius: 50%;
        position: absolute;
        top: -5px;
        left: -5px;

        &_red {
            background-color: $red;
        }
    }

    &__icon {
        position: absolute;
        bottom: 50%;
        left: 35%;
        transform: translateY(50%);
        max-width: 180%;
        transition: ease-out .18s;

        @include mobile {
            max-width: 120%;
            position: relative;
            bottom: 0;
            left: 0;
            transform: unset;
        }
    }

    &__more {
        margin: 64px auto 0;
        display: block;

        @include mobile {
            margin: 34px auto 0;
        }
    }
}

sources.scss\\services.scss:
.services-block {
    margin-top: 57px;

    &__grid {
        display: grid;
        grid-template-columns: repeat(auto-fit, minmax(280px, 1fr));
        grid-gap: 49px 39px;
        margin-top: 59px;
    }

    &__item {
        background-color: rgba(0, 0, 0, 0.8);
        background-size: cover;
        min-height: 205px;
        border-radius: 20px 0;
        display: flex;
        flex-direction: column;
        justify-content: space-between;
        color: inherit;
        text-decoration: none;

        @for $i from 1 through 6 {
            $delay: random(5) + random(100)/100 + s;

            &:nth-of-type(#{$i}) .services-block__percent {
                animation: pulse 8s $delay ease-in-out infinite;
            }
        }
    }

    &__subtitle {
        background: rgba(0, 0, 0, 0.8);
        text-align: center;
        padding: 3px 15px;
        font-weight: 300;
        font-size: 30px;
        line-height: 34px;
        color: #fff;
        border-radius: 20px 0 0 0;
        text-transform: uppercase;

        @include mobile {
            font-size: 20px;
        }
    }

    &__discount {
        display: flex;
        align-items: center;
        justify-content: space-between;
        padding: 5px 12px;
        font-weight: normal;
        font-size: 14px;
        text-align: center;
        color: #fff;
        background: rgba(0, 0, 0, 0.8);
        border-radius: 0 0 20px 0;

        span {
            z-index: 1;
            position: relative;
        }
    }

    &__percent {
        font-weight: 800;
        font-size: 37px;
        line-height: 34px;
        color: $red;
        position: relative;

        &:before {
            content: '';
            position: absolute;
            height: 74px;
            width: 74px;
            background-color: $yellow;
            left: -28px;
            transform: translateY(50%);
            bottom: 50%;
            border-radius: 50%;
        }
    }

    &__actions {
        margin-top: 67px;
        display: flex;
        justify-content: center;

        @include mobile {
            flex-direction: column;
            align-items: center;
        }
    }

    &__btn {
        min-width: 188px;


        &+.services-block__btn {
            margin-left: 14px;

            @include mobile {
                margin-left: 0;
                margin-top: 14px;
            }
        }
    }
}


@keyframes pulse {

    0%,
    20%,
    40% {
        transform: scale(1);
    }

    10%,
    30% {
        transform: scale(1.1);
    }
}

