.form {
    width: 435px;
    max-width: 100%;
    background-color: #fff;
    border-radius: 10px;
    overflow: hidden;
    position: relative;
    padding: 32px 0;
    transform: translateY(-100vh);
    transition: all ease-out .2s;
    cursor: default;

    @include mobile {
        padding: 42px 0px 32px;
    }


    &:before {
        content: "";
        background: $yellow;
        top: 0;
        left: 6px;
        width: 130%;
        height: 200px;
        transform: rotate(-7deg) translateY(-50%);
        border-radius: 30px;
        position: absolute;
    }

    &:after {
        content: "";
        background: $soft-black;
        bottom: 0;
        right: 10px;
        width: 130%;
        height: 230px;
        transform: rotate(-7deg) translateY(50%);
        border-radius: 30px;
        position: absolute;
    }

    &__close {
        position: absolute;
        z-index: 3;
        top: 10px;
        right: 14px;
        cursor: pointer;

        @include mobile {
            width: 15px;
            height: 15px;
        }
